import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './Home'; // Importa a página inicial
import Resumo from './Resumo'; // Importa a página de resumo

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} /> {/* Rota para a página inicial */}
        <Route path="/resumo" element={<Resumo />} /> {/* Rota para a página de resumo */}
      </Routes>
    </Router>
  );
};

export default App;
